style.css:
@-moz-document domain("meine.deutsche-bank.de") {
    body {
        color: #333;
    }
    #DisplayTransactions table.sortable tr.hasSEPADetails + tr table td {
        color: #666;
    }
    #headerContainer .teaser, #topicContainer .advice {
        display: none;
    }
    #globalNavigation #indicatorNew, #globalNavigation #indicatorNew a:before {
        display: none;
    }
    #DisplayTransactions .formContainer .previousStep {
        display: none;
    }
    #login #verimiContainer {
        display: none;
    }
}
